The hour hand is $\frac{48}{60} = \frac45$ of the way from hour 2 to hour 3, so it is $\frac45\cdot 30^\circ = 24^\circ$ past hour 2.  So, the hour hand is $2\cdot 30^\circ + 24^\circ = 84^\circ$ past hour 12.

