draw((1,0,1)--(1,0,0),gray(0.7));
draw((0,0,1)--(0,0,0),gray(0.7));
draw((0,1,1)--(0,1,0),gray(0.7));
draw(circ,dashed);
draw(A--B--C);
draw(C--M--P,dashed);
draw(A--P);
draw(B--P);

dot("$A$", A, SW);
dot("$B$", B, NW);
dot("$B'$", Bp, NW);
dot("$C$", C, S);
dot("$M$", M, NE);
dot("$P$", P, N);
dot("$Q$", Q, N);
dot("$R$", R, N);
label("$\ell$", (-0.2,1.2,1), E);
