Let $d$ denote the distance from the center of the sphere to the center of the base of the cone.

[asy]
scale(100);

draw(unitcircle);

real s = sqrt(3)/2;

pair A=(0,1);
pair B=(-s,-1/2);
pair C=(s,-1/2);
pair D=(0,-1/2);
pair OO = (0,0);

draw(A--B--C--A--D);
draw(B--OO);
label("$d$",.5D,E);
[/asy]

Since the sphere has radius 1, we can use the Pythagorean Theorem to find other values.

[asy]
scale(100);

draw(unitcircle);

real s = sqrt(3)/2;

pair A=(0,1);
