unitsize(1 cm);

pair A, B, C, D, E, F;
real e, t;

A = (5,0);
B = (0,2*sqrt(3));
C = (0,0);

e = 1;
t = (e + 5)/11;
E = (e,0);
F = ((1 - t)*5,2*t*sqrt(3));
D = rotate(60,E)*(F);

draw(A--B--C--cycle);
draw(D--E--F--cycle);

label("$a$", A, SE);
label("$b$", B, NW);
label("$c$", C, SW);
label("$d$", D, W);
label("$e$", E, S);
label("$f$", F, NE);
[/asy]

Since the small triangle is equilateral, $d - e = \operatorname{cis} 60^\circ \cdot (f - e),$ or
